    return(
        <React.Fragment>
            <div className="col-lg-6 mb-4">
                <div className="card shadow mb-4">
                    <div className="card-header py-3">
                     
                        <h6 className="m-0 font-weight-bold text-danger ">Nuestros Productos</h6>
                        
                    </div>

                    <div className=" mb-2">
    <button type="button" class="btn btn-info">Artística</button>;
	<button type="button" class="btn btn-info">Técnico</button>
    </div>
                    <div className="card-body">
                        <div className="text-center">
                            <img className="img-fluid px-3 px-sm-4 mt-3 mb-4" style={{width: 100 +'rem'}} src={photo_home_3} alt="image dummy"/>
                        </div>
                        <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Dolores, consequatur explicabo officia inventore libero veritatis iure voluptate reiciendis a magnam, vitae, aperiam voluptatum non corporis quae dolorem culpa exercitationem ratione?</p>
